import React from "react";
import { lg_api } from "../../__modules__";

class CreatePost extends React.Component {
  constructor() {
    super();
    this.state = { post: [] };
  }

  componentDidMount() {
    lg_api("posts/", {
      method: "post",
    });
  }
}

export { CreatePost };
